import React, { Component } from 'react';
import './Menu.css';
import SlideToggle from 'react-slide-toggle';
import { Link, animateScroll as scroll } from "react-scroll";


class Menu extends Component {

    render() {
        return (
            <SlideToggle
                duration={800}
                collapsed
                render={({toggle, setCollapsibleElement, progress}) => (
                    <div className="menu">
                        <div className="desktop-menu">
                            <div className={'logo'}><a>Nebojsa Mitrovic</a></div>
                            <div className={'mobile-menu'}>
                                <div className="slide-toggle__header">
                                    <div className="slide-toggle__button">
                                        <div className={'line'}/>
                                        <div className={'line'}/>
                                        <div className={'line'}/>
                                    </div>
                                </div>
                                <div className="slide-toggle__box" ref={setCollapsibleElement}>
                                    <div className="slide-toggle__box-inner" style={{opacity: Math.max(0.5, progress)}}>
                                        <div className={'menu-items mobile-menu-items'} ref={'menu-items'}>
                                            <a className={'menu-item'}>About</a>
                                            <a className={'menu-item'}>Skills</a>
                                            <a className={'menu-item'}>Portfolio</a>
                                            <a className={'menu-item'}>Contact</a>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div className={'menu-items menu-top'} ref={'menu-items'}>
                                <a className={'menu-item'} onClick={() => scrollToComponent(this.Violet, { offset: 0, align: 'top', duration: 1500})}>About Me</a>
                                <a className={'menu-item'}>Skills</a>
                                <a className={'menu-item'}>Portfolio</a>
                                <a className={'menu-item'}>Contact</a>
                            </div>
                        </div>

                    </div>
                )}
            />
        );
    }
}
export default Menu;
